def zipTS2absoluteTS(ts):
    x,y = zip(*sorted(ts, key=lambda x: x[0]))
    result = np.zeros(max(x)+1)
    for i,val in enumerate(x):
        result[val] = y[i]
    return result

all_users = list(kvs.keys())
dmatrix = np.zeros((len(all_users),len(all_users)))

for i,u1 in tqdm(enumerate(all_users)):
    for j,u2 in enumerate(all_users):
        if i==j:
            pass
        elif j>i:
            tsi = [ (x-norms[l])/norms[l] for l,x in enumerate(zipTS2absoluteTS(kvs[u1]))]
            tsj = [ (x-norms[l])/norms[l] for l,x in enumerate(zipTS2absoluteTS(kvs[u2]))]
            dmatrix[i][j] = fastdtw(tsi,tsj)[0]
        elif j<i:
            dmatrix[i][j] = dmatrix[j][i]

with open("dmatrix_%i.pickle"%num_keys,'wb') as f:
    pickle.dump(dmatrix,f)
